angular.module("AsifHayir").controller("photolabels", function ($scope) {


    var type = "LABEL_DETECTION";
    var a = "";

    // Strip out the file prefix when you convert to json.
    var json = '{' +
    ' "requests": [' +
    '	{ ' +
    '	  "image": {' +
    '	    "content":"' + a + '"' +
    '	  },' +
    '	  "features": [' +
    '	      {' +
    '	      	"type": "' + type + '",' +
    '			"maxResults": 200' +
    '	      }' +
    '	  ]' +
    '	}' +
    ']' +
    '}';

    $.ajax({
        type: 'POST',
        url: "https://vision.googleapis.com/v1/images:annotate?key=AIzaSyA-bpxB2TRHx8w7meL8DWIvjQ7xbRHRFks",
        dataType: 'json',
        data: json,
        //Include headers, otherwise you get an odd 400 error.
        headers: {
        "Content-Type": "application/json",
        },
    
        success: function(data, textStatus, jqXHR) {
        var labels = "התרומה כוללת: ";
                var element = document.getElementById("labels");

                for (var i=0; i<data.responses[0].labelAnnotations.length; i++){
                    labels += data.responses[0].labelAnnotations[i].description;
                    labels += ", ";
                }

                element.innerHTML = labels
        },
        error: function(jqXHR, textStatus, errorThrown) {
        console.log('ERRORS: ' + textStatus + ' ' + errorThrown);
        }
  });

});
